        #endregion

        public FontAwesomeIcon(FontAwesomeCategory category, FontAwesome value, string name, string cssName)
            : base(IconType.FontAwesome, (int) value, name, cssName)
        {
            _Category = category;
        }

        [DataMember(Order = 4)]
        readonly FontAwesomeCategory _Category;

        public FontAwesomeCategory Category { get { return _Category; } }

        public override string ToClass(FontScale scale)
        {
            switch (scale)
            {
                case FontScale.x1:
                    return "fa fa-" + base.CssName + " fa-1";
                case FontScale.x2:
                    return "fa fa-" + base.CssName + " fa-2";
                case FontScale.x3:
                    return "fa fa-" + base.CssName + " fa-3";
                case FontScale.x4:
                    return "fa fa-" + base.CssName + " fa-4";
                case FontScale.x5:
                    return "fa fa-" + base.CssName + " fa-5";
                case FontScale.x6:
                    return "fa fa-" + base.CssName + " fa-6";

                case FontScale.Default:
                default:
                    return "fa fa-" + base.CssName;
            }
        }

    }
